import React from "react";
import { Col, Row } from "reactstrap";

class Savecards extends React.Component{
    render(){
        return(
            <Col lg="4" md="6" sm="9" xs="9">
                <div className="card-wrap">
                    <div className="cover">
                        <ul>
                            <li>first</li>
                            <li>second</li>
                            <li>third</li>
                        </ul>
                    </div>
                    
                </div>
            </Col>

        );

    }

}
export default Savecards;
